INSERT INTO `litemall_brand` VALUES (1001000,'PRO专业求助','HelpEasePro精选了PRO专业求助包括专业领域中遇到的问题，如电脑维修、汽车维护、法律咨询、财务管理等方面的求助','https://i.328888.xyz/2023/04/04/ijEObc.png',2,12.90,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1001002,'学术求助','HelpEasePro从互联网世界挑选了包括学生在学习中遇到的问题，如数学、语言、科学等方面的疑问，以及对于考试、论文等方面的求助','https://i.328888.xyz/2023/04/04/ijEHiJ.png',10,29.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1001003,'心理求助','HelpEasePro找到为心理求助包括心理健康方面的求助，如焦虑、抑郁、失眠等方面的问题，以及心理辅导和咨询等服务','https://i.328888.xyz/2023/04/04/ijEl3X.png',30,49.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1001007,'Life生活求助','HelpEasePro精选了生活求助包括社会居民在日常生活中遇到的问题，如家庭、职业、健康、交通等方面的求助','https://i.328888.xyz/2023/04/04/ijEwSt.png',12,29.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1001008,'网络安全求助','HelpEasePro精选了网络安全求助包括个人信息安全、网络诈骗、电信网络安全等方面的问题，以及网络安全公司和安全咨询服务等服务','https://i.328888.xyz/2023/04/04/ijzHTo.png',40,45.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1001010,'财经求助','HelpEasePro精选了财经求助包括理财、投资、保险、税务等方面的问题，以及财经咨询和金融机构等服务','https://i.328888.xyz/2023/04/04/ijz2eA.png',34,39.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1001012,'孕育求助','HelpEasePro精选了孕育求助包括备孕、孕期、产后等方面的问题，以及孕育咨询和母婴护理等服务','https://i.328888.xyz/2023/04/04/ijzbkN.jpeg',21,39.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1001013,'房产求助','HelpEasePro精选了房产求助包括房产买卖、租赁、装修、维修等方面的问题，以及房产中介和装修公司等服务','https://i.328888.xyz/2023/04/04/ijzjBV.png',47,24.90,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1001015,'社交娱乐求助','HelpEasePro精选了社交娱乐包括社交娱乐、休闲娱乐、户外活动等方面的问题，以及社交活动组织和旅游公司等的服务','https://i.328888.xyz/2023/04/04/ijz89d.jpeg',49,14.90,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1001016,'语言求助','HelpEasePro精选了语言求助包括语言学习、口语练习、翻译等方面的问题，以及语言培训机构和翻译公司等的服务','https://i.328888.xyz/2023/04/04/ijzNAb.jpeg',9,35.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1001020,'法律求助','HelpEasePro精选了法律求助包括法律咨询、法律援助、律师代理等方面的问题，以及法律服务机构和律师事务所等的服务','https://i.328888.xyz/2023/04/04/ijzrNq.png',20,29.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1001037,'物业求助','HelpEasePro精选了物业求助包括物业管理、装修、维修等方面的问题，以及物业管理公司和维修服务商等的服务','https://i.328888.xyz/2023/04/04/ijz3hz.png',5,59.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1001038,'婚恋求助','HelpEasePro精选了婚恋求助包括恋爱技巧、婚姻生活、感情挽回等方面的问题，以及情感咨询和婚姻家庭治疗等服务','https://i.328888.xyz/2023/04/04/ijzcZw.jpeg',3,49.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1001039,'玩具求助','HelpEasePro精选了玩具求助包括玩具购买、使用、维修等方面的问题，以及儿童玩具安全和教育等服务','https://i.328888.xyz/2023/04/04/ijzmHa.png',17,79.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1001045,'健身求助','HelpEasePro精选了健身求助包括健身运动、健康饮食、营养保健等方面的问题，以及健身指导和私人教练等服务','https://i.328888.xyz/2023/04/04/ijzpex.jpeg',45,699.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1003000,'美食求助','HelpEasePro精选了美食求助包括美食鉴赏、烹饪技巧、食材选择等方面的问题，以及美食推荐和餐饮咨询服务','https://i.328888.xyz/2023/04/04/ij6dob.jpeg',41,19.90,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1005001,'旅游求助','HelpEasePro精选了旅游求助包括旅游路线、住宿、餐饮、景点等方面的问题，以及旅游指南和定制服务','https://i.328888.xyz/2023/04/04/ijzBak.jpeg',48,39.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1006000,'文化求助','HelpEasePro精选了文化求助包括艺术、历史、文学、哲学等方面的疑问，以及相关资源和学习机会的推荐','https://i.328888.xyz/2023/04/04/ijzgkL.png',18,99.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1008000,'宠物求助','HelpEasePro精选了宠物求助包括宠物饲养、训练、健康等方面的问题，以及宠物医疗、保健等服务','https://i.328888.xyz/2023/04/04/ijzxBp.png',22,59.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1010001,'灾难求助','HelpEasePro精选了灾难求助包括自然灾害、人为灾害等突发事件所引发的求助，如救援、安置、物资支援等方面的服务','https://i.328888.xyz/2023/04/04/ijz7JU.png',39,29.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1010002,'创业求助','HelpEasePro精选了创业求助包括创业者在创业过程中遇到的问题，如融资、市场营销、管理等方面的求助，以及创业指导和孵化服务','https://i.328888.xyz/2023/04/04/ijzeAv.png',19,29.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1015000,'科技求助','HelpEasePro精选了科技求助包括电脑、手机、网络、软件等方面的问题，以及相关技术支持和培训服务','https://i.328888.xyz/2023/04/04/ijzzr3.png',43,69.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1016002,'社会公益求助','HelpEasePro精选了社会公益求助包括参与社会公益活动、义工服务等方面的求助，以及环保、慈善、公益组织等方面的咨询和支持服务','https://i.328888.xyz/2023/04/04/ijzGZ5.png',11,45.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1018000,'家庭求助','HelpEasePro精选了家庭求助包括家庭关系方面的求助，如夫妻关系、子女教育、老人护理等问题，以及家庭咨询和治疗等服务','https://i.328888.xyz/2023/04/04/ijzdO8.png',32,199.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1021000,'职业求助','HelpEasePro精选了职业求助包括职场中遇到的问题，如升职、转行、职业规划等方面的求助，以及职业技能培训和就业指导等服务','https://i.328888.xyz/2023/04/04/ijzhzZ.png',24,69.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),(1022000,'社交求助','HelpEasePro精选了社交求助包括社交关系方面的求助，如人际交往、沟通技巧、社交焦虑等问题，以及朋友、恋爱、婚姻等方面的求助','https://i.328888.xyz/2023/04/04/ijz5aF.png',29,59.00,'2018-02-01 00:00:00','2018-02-01 00:00:00',0);
