INSERT INTO `litemall_comment` VALUES (1,1064002,0,'加油，身体素质需要长期的训练和坚持，一步步来，不要放弃！找到一个好的教练和合适的训练计划可以帮助你达到目标。','',16,1,'[\"https://i.328888.xyz/2023/04/24/iSJCmx.png\"]',1,'2023-04-01 00:00:00','2023-04-01 00:00:00',0),
(2,1064002,0,'为了提高身体素质，除了有规律的训练外，还需要注意饮食和休息。保证充足的睡眠和饮食，让身体得到充分的恢复。~','',1,1,'[\"https://i.328888.xyz/2023/04/24/iSJ0ta.png\"]',1,'2023-04-01 00:00:00','2023-04-01 00:00:00',0),
(3,1064002,0,'坚持训练和自我激励是很重要的。你可以跟同伴一起训练，互相监督和鼓励。同时，设立目标并记录训练进度，可以帮助你激发动力，不断进步。','',15,1,'[\"https://i.328888.xyz/2023/04/24/iSJWPw.png\"]',1,'2023-04-01 00:00:00','2023-04-01 00:00:00',0),
(4,1064002,0,'选择适合自己的训练方式。如果你不喜欢某个运动项目，即使强迫自己也难以坚持。找到适合自己的训练方式，可以让你更加投入和享受训练过程。','',2,1,'[\"https://i.328888.xyz/2023/04/24/iSJt7z.png\"]',1,'2023-04-01 00:00:00','2023-04-01 00:00:00',0),
(5,1064002,0,'最后，体育不仅仅是身体素质的提高，更是一种生活方式和态度。通过体育锻炼，你可以锻炼毅力和决心，养成坚韧不拔的精神品质，这对你未来的发展将有很大的帮助。','',14,1,'[\"https://i.328888.xyz/2023/04/24/iSJnwq.png\"]',1,'2023-04-01 00:00:00','2023-04-01 00:00:00',0),

(6,271,1,'旅游是一件很美好的事情，但找女朋友的目的可能不够纯粹。建议先找到自己真正想要的女生类型，并慢慢建立感情，不要急于求成。','',3,1,'[\"https://i.328888.xyz/2023/04/24/iSJh4o.png"]',1,'2023-04-01 00:00:00','2023-04-01 00:00:00',0),
(7,271,1,'真正的爱情需要慢慢培养和沉淀，而不是为了满足自己的需求而随便找一个人。建议多参加社交活动，扩大自己的社交圈子，让缘分自然到来。','',13,0,'[]',1,'2018-02-01 00:00:00','2018-02-01 00:00:00',0),
(8,271,1,'建议多关注自己的内在修养和品质，这样才能吸引到合适的人。外在的旅游经历固然重要，但更重要的是对待生活的态度和人生的追求。','',4,1,'[\"https://i.328888.xyz/2023/04/24/iSJG9A.png"]',1,'2023-04-01 00:00:00','2023-04-01 00:00:00',0),
(9,271,1,'爱情不是一种单方面的需求，需要双方互相理解和支持。建议多关注异性的需求和感受，建立良好的沟通和信任，才能有更美好的未来。','',12,0,'[]',1,'2023-04-01 00:00:00','2023-04-01 00:00:00',0),
(10,271,1,'最后，希望你能够找到自己真正的爱情和旅伴。不要着急，缘分会在恰当的时候到来。在等待的过程中，可以多尝试新的旅行方式和目的地，充实自己的生活。','',5,1,'[\"https://i.328888.xyz/2023/04/24/iSJFpc.png"]',1,'2023-04-01 00:00:00','2023-04-01 00:00:00',0),

(11,1110016,0,'很遗憾听到你的宠物猫失踪了。首先要冷静，尝试回想猫咪走失的时间和地点，并沿着猫咪可能走过的路线寻找。可以贴上寻猫启示，寻求社区和邻居的帮助。','',11,0,'[]',1,'2023-04-01 00:00:00','2023-04-01 00:00:00',0),
(12,1110016,0,'宠物猫可能会被吸引到喜欢吃的食物，可以在猫咪走失的附近或它常去的地方放置猫粮或臭豆腐，吸引它回来。同时，可以用它最喜欢的玩具或毛巾，在附近摆放，增加猫咪回归的可能性。','',6,0,'[]',1,'2023-04-01 00:00:00','2023-04-01 00:00:00',0),
(13,1110016,0,'如果寻找猫咪不成功，可以考虑寻求志愿者或宠物救助组织的帮助。他们可能有更丰富的经验和资源，能够更快地找到猫咪。','',10,0,'[]',1,'2023-04-01 00:00:00','2023-04-01 00:00:00',0),
(14,1110016,0,'在找猫的过程中，要保持耐心和信心。有时猫咪可能会躲藏或者被困在某个地方，需要花费一些时间和精力才能找到。不要放弃，坚持寻找。','',1,0,'[]',1,'2023-04-01 00:00:00','2023-04-01 00:00:00',0),
(15,1110016,0,'最后，希望你能早日找到宠物猫。在猫咪回家之前，也可以尝试去当地宠物收容所看看，有时会有类似的猫咪被送到那里。如果猫咪确实无法找到，也可以考虑领养其他的宠物，给它们一个温暖的家。','',7,0,'[]',1,'2023-04-01 00:00:00','2023-04-01 00:00:00',0),
(16,1110016,0,'','',9,1,'[\"https://i.328888.xyz/2023/04/22/i5RU5v.jpeg"]',1,'2023-04-01 00:00:00','2023-04-01 00:00:00',0),

(17,1006002,0,'不错','',8,0,'[]',1,'2023-04-01 00:00:00','2023-04-01 00:00:00',0);


